import "bootstrap/dist/css/bootstrap.min.css";
import $ from "jquery";
import Popper from "popper.js";
import "bootstrap/dist/js/bootstrap.bundle.min";
import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

class Kompo extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      text: ""
    };
  }

  render() {
    const style = {
      background: "red",
      fontSize: "5px",
      marginTop: "0px"
    };
    return <button>moi</button>;
  }
}

ReactDOM.render(<Kompo />, document.getElementById("root"));
